INSERT INTO `galaxy` VALUES (1, '0000001', 'Ethereum', 'Ethereum is a decentralized open-source blockchain system that features its own cryptocurrency, Ether. ETH works as a platform for numerous other cryptocurrencies, as well as for the execution of decentralized smart contracts.  Ethereum was first described in a 2013 whitepaper by Vitalik Buterin. Buterin, along with other co-founders, secured funding for the project in an online public crowd sale in the summer of 2014. The project team managed to raise $18.3 million in Bitcoin, and Ethereum‚Äôs price in the Initial Coin Offering (ICO) was $0.311, with over 60 million Ether sold. Taking Ethereum‚Äôs price now, this puts the return on investment (ROI) at an annualized rate of over 270%, essentially almost quadrupling your investment every year since the summer of 2014.  The Ethereum Foundation officially launched the blockchain on July 30, 2015, under the prototype codenamed ‚ÄúFrontier.‚Äù Since then, there has been several network updates ‚Äî ‚ÄúConstantinople‚Äù on Feb. 28, 2019, ‚ÄúIstanbul‚Äù on Dec. 8, 2019, ‚ÄúMuir Glacier‚Äù on Jan. 2, 2020, ‚ÄúBerlin‚Äù on April 14, 2021, and most recently on Aug. 5, 2021, the ‚ÄúLondon‚Äù hard fork.  Ethereum‚Äôs own purported goal is to become a global platform for decentralized applications, allowing users from all over the world to write and run software that is resistant to censorship, downtime and fraud.', 'https://www.ethereum.org/', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (2, '0000002', 'USD Coin', 'USD Coin (known by its ticker USDC) is a stablecoin that is pegged to the U.S. dollar on a 1:1 basis. Every unit of this cryptocurrency in circulation is backed up by $1 that is held in reserve, in a mix of cash and short-term U.S. Treasury bonds. The Centre consortium, which is behind this asset, says USDC is issued by regulated financial institutions. <br/> The stablecoin originally launched on a limited basis in September 2018. Put simply, USD Coin‚Äôs mantra is ‚Äúdigital money for the digital age‚Äù ‚Äî and the stablecoin is designed for a world where cashless transactions are becoming more common. <br/> Several use cases have been unveiled for the USD Coin. As well as providing a safe haven for crypto traders in times of volatility, those behind the stablecoin say it can also allow businesses to accept payments in digital assets, and shake up an array of sectors including decentralized finance and gaming.s', 'https://www.centre.io/usdc', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (3, '0000003', 'IDZ Asset 0', 'For 5 years, we have been working tirelessly to revolutionise the identity/ownership space to finally introduce the ID ecosystem, so you can have ALL THE CONTROL in YOUR hands. <br/> Take control of your data. Own and control your assets, contracts, chats and files. <br/> Asset 0 is the first asset in the ID ecosystem. Its value is linked to the number of users in IDZ. As the number of users in the system increases, so does the value. <br/> Asset 0 comes with a buyback guarantee, meaning you will always find a buyer for it after IDZ‚Äôs IPO. <br/> When you own Asset 0, you become an IDZ Ambassador giving you access to exclusive benefits. <br/> In the primary market, the floor price of Asset 0 will increase progressively on a weekly basis. Secure its cheapest price now!', 'https://idz.com/', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (4, '0000004', 'Cybee NFTs with Passive Income', 'Cybee DAO aims to establish the biggest NFT community and a huge Dapp and GameFi ecosystem that provides passive income and benefits for all holders. <br/> Once you mint a Cybee, you will get the Cybee DAO membership and $CBD token rewards. Meanwhile, you can get the ticket to Invite to Earn and earn ETH rewards, receive 3D Cybee and NFT Derivatives airdrop and play to earn $CBD in Cybee Ecosystem. <br/> In addition to the appreciation of NFT, Cybee DAO will distribute a portion of the net revenue to all holders at a fixed time, such as quarterly or annually. The amount will be calculated based on the proportion to their holdings.', 'https://cybeedao.io/official', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (5, '0000005', 'Azuki Demon', '6666 Azuki went through a chemical explosion, living underground on the ETH blockchain. Azuki Demons are bigger, more brutal and stronger. <br/>   Azuki Demon is Created by 3 Azuki Holders. Once you mint an Azuki Demon, you will get the Azuki Demon DAO membership and Airdrop $ZUKI token rewards. Meanwhile, you can get the ticket to receive 3D Azuki Demon and NFT Derivatives airdrop and play to earn $ZUKI in Zuki Ecosystem. <br/> In addition to the appreciation of NFT holders, Azuki Demon DAO will distribute a portion of the net revenue to all holders at a fixed time, such as quarterly. The amount will be calculated based on the proportion to their holdings.', 'https://azukidemon.com/', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (6, '0000006', 'TapeHeads', 'Access to TapeHead Land on Sandbox for exclusive events <br/> Voting rights on the development of the metaverse <br/> Cost-free rental on TapeHeads Land for events <br/> Sandbox avatars for early adopters <br/> Exclusive first dibs on our future NFT collection drops <br/> Exclusive limited edition and rare merchandise <br/> Access to our \'Music in the Metaverse\' podcast', 'https://www.tapeheads.io/', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (7, '0000007', 'Etherscan', 'Etherscan is a blockchain explorer for the Ethereum network. The website allows you to search through transactions, blocks, wallet addresses, smart contracts, and other on-chain data. It\'s one of the most popular Ethereum blockchain explorers and is free to use. Using Etherscan can help you understand exactly how you interact with the blockchain, other wallets, and DApps. This knowledge can also help you stay safe and spot suspicious behavior. To use Etherscan, you\'ll need a wallet address, transaction ID (TXID), contract address, or another identifier to paste into the search field. The information you\'ll see will depend on what you\'re looking at, but most of it will include associated transactions, addresses, timestamps, and amounts. You can also interact directly with smart contracts to make transactions, check gas fees, and search for airdrops through Etherscan.', 'https://etherscan.io', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000007.png', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (8, '0002900', 'Discoverilla', 'The Discoverilla project aims to guarantee advertising space using 3D Galaxy space to all NFT holders. NFT Holders can advertise projects, companies, products, etc. by using Dashboard and change them as needed. Whitelist Members have a higher probability of banner advertisement effect, and as they contribute to the project, they can secure more space in advertisement probability and 3D space. Let\'s turn more attention to the project and increase our advertising spot with more space and more probability.', 'https://discoverilla.com', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
