INSERT INTO `galaxy` VALUES (15, '0009806', 'Worldwide Asset eXchange (WAX)', 'WAX is the safest and most convenient way to create, buy, sell, and trade virtual items - to anyone, anywhere in the world. Hundreds of millions of people around the globe already trade digital and physical items. But the problems that plague the digital goods and trading community have stunted its growth far beneath its full potential.WAX has created a full suite of blockchain-based tools that allows anyone to trade digital or even physical items instantly and securely, to anyone, anywhere.Participants of the Worldwide Asset eXchange gain access to a global community of collectors and traders, buyers and sellers, creators and gamers, merchants, dApp creators, and game developers.', 'https://on.wax.io/about-wax/', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
