INSERT INTO `galaxy` VALUES (17, '0009808', 'Meta', 'Meta builds technologies that help people connect, find communities, and grow businesses. When Facebook launched in 2004, it changed the way people connect. Apps like Messenger, Instagram and WhatsApp further empowered billions around the world. Now, Meta is moving beyond 2D screens toward immersive experiences like augmented and virtual reality to help build the next evolution in social technology.', 'https://www.metacareers.com/', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
