INSERT INTO `galaxy` VALUES (19, '0009807', 'SEO Locale, LLC', 'SEO Locale was started in 2015 by digital marketing experts who have over 15 years of experience in this industry. As a full service digital marketing agency, SEO Locale offer specialized in local search engine optimization, national search engine optimization, web design, web development, paid search management, social media management, mobile app development, reputation management, content strategy and optimization and email marketing.', 'https://seolocale.com/', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
