INSERT INTO `galaxy` VALUES (22, '0009803', 'SPARK Neuro', 'SPARK Neuro is a leading applied neuroscience company that collects and quantifies data to create machine-learning based brain health biomarkers for better clinical care and therapeutic discovery. SPARK‚Äôs Drug Development Dashboard provides intelligence on drug behavior at the earliest stages, saving time and money throughout the course of drug development.', 'https://medical.sparkneuro.com/', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (23, '0009802', 'Broadwing', 'Broadwing is a boutique engineering services organization built around a virtual community of high-quality colleagues that share a love for solving difficult customer challenges.We have a strong emphasis on senior experience, so whether you are just starting your career or are already a well-known expert, you will find that we provide an environment that encourages you to learn and grow. We understand that our diversity feeds our inventive customer solutions, therefore we\'re always on the lookout for people with interesting backgrounds and experiences. You\'ll enjoy working with us if you\'ve ever felt like an outcast in a standard business structure. We work hard to play to your strengths, appreciate you, and welcome you into our culture of cooperation, information sharing, and \'having each other\'s back\' Broadwing has been a completely remote corporation since its inception. We mitigate our rapid growth by insisting on our essential values of collaboration, friendship, and fun, even though we are geographically agnostic. Professionally, our engineers gain experience working on large-platform projects and cutting-edge technologies in industries like Fintech, Healthcare, and Crypto, allowing them to quickly develop an attractive resume with a diverse skill set. Broadwing is the place for you if you despise \'babysitting\' production systems, if you feel like you\'re missing out on evolving technology, and if you want to take your experience to the next level.', 'https://www.broadwing.io/', 'Special', '0.02%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (24, '0001853', 'TRON', 'TRON (TRX) is a decentralized blockchain-based operating system developed by the Tron Foundation and launched in 2017. Originally TRX tokens were ERC-20-based tokens deployed on Ethereum, but a year later they were moved to their own network. <br/> Initially, the project was created with the aim of providing full ownership rights to makers of digital content. The main goal is to help content creators (who receive only a small part of the income) and encourage them with more rewards for their work. How: invite content consumers to reward content makers directly (without intermediaries like YouTube, Facebook or Apple). <br/> The TRON software supports smart contracts, various kinds of blockchain systems, and decentralized applications aka dApps. The cryptocurrency platform uses a transaction model similar to Bitcoin (BTC), namely UTXO. Transactions take place in a public ledger, where users can track the history of operations. <br/> Therefore, the platform was built to create a decentralized Internet and serves as a tool for developers to create dApps, acting as an alternative to Ethereum. Anyone can create dApps on the TRON network, offer content, and in return receive digital assets as compensation for their efforts. The ability to create content and share it openly without hesitation regarding transaction fees is an undeniable advantage of TRON.', 'https://tron.network/', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (25, '0002990', 'Cronos', 'Cronos (CRO) is the native cryptocurrency token of Cronos Chain ‚Äî a decentralized, open-source blockchain developed by the Crypto.com payment, trading and financial services company. <br/> Cronos Chain is one of the products in Crypto.com‚Äôs lineup of solutions designed to accelerate the global adoption of cryptocurrencies as a means of increasing personal control over money, safeguarding user data and protecting users‚Äô identities. The CRO blockchain serves primarily as a vehicle that powers the Crypto.com Pay mobile payments app. <br/> In the future, Crypto.com plans to expand the reach of the CRO platform to power its other products as well. <br/> CRO went live in November-December 2018.', 'https://www.crypto.com/en/chain', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (26, '0001376', 'Solana', 'Solana is a highly functional open source project that banks on blockchain technology‚Äôs permissionless nature to provide decentralized finance (DeFi) solutions. While the idea and initial work on the project began in 2017, Solana was officially launched in March 2020 by the Solana Foundation with headquarters in Geneva, Switzerland. <br/> To learn more about this project, check out our deep dive of Solana. <br/> The Solana protocol is designed to facilitate decentralized app (DApp) creation. It aims to improve scalability by introducing a proof-of-history (PoH) consensus combined with the underlying proof-of-stake (PoS) consensus of the blockchain. <br/> Because of the innovative hybrid consensus model, Solana enjoys interest from small-time traders and institutional traders alike. A significant focus for the Solana Foundation is to make decentralized finance accessible on a larger scale.', 'https://solana.com/', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (27, '0001054', 'Avalanche', 'Avalanche is the fastest smart contracts platform in the blockchain industry, as measured by time-to-finality. Avalanche is blazingly fast, low cost, and eco-friendly. Any smart contract-enabled application can outperform its competition by deploying on Avalanche. <br/> Avalanche launched on mainnet, September 21, 2020. Since then, the platform has grown to secure over 450+ individual projects, $118M+ of AVAX burned (reducing supply), 1,350+ individual block-producing validators, and over 1.5M+ community members around the globe.', 'https://avax.network/', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (28, '0000794', 'Binance USD', 'Binance USD (BUSD) is a 1:1 USD-backed stable coin issued by Binance (in partnership with Paxos), Approved and regulated by the New York State Department of Financial Services (NYDFS), The BUSD Monthly Audit Report can be viewed from the official website. Launched on 5 Sep 2019, BUSD aims to meld the stability of the dollar with blockchain technology. It is a digital fiat currency, issued as ERC-20 and supports BEP-2.', 'https://www.binance.com/en/busd', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (29, '0000793', 'Tether', 'USDT is a stablecoin (stable-value cryptocurrency) that mirrors the price of the U.S. dollar, issued by a Hong Kong-based company Tether. The token‚Äôs peg to the USD is achieved via maintaining a sum of commercial paper, fiduciary deposits, cash, reserve repo notes, and treasury bills in reserves that is equal in USD value to the number of USDT in circulation. <br/> Originally launched in July 2014 as Realcoin, a second-layer cryptocurrency token built on top of Bitcoin‚Äôs blockchain through the use of the Omni platform, it was later renamed to USTether, and then, finally, to USDT. In addition to Bitcoin‚Äôs, USDT was later updated to work on the Ethereum, EOS, Tron, Algorand, and OMG blockchains. <br/> The stated purpose of USDT is to combine the unrestricted nature of cryptocurrencies ‚Äî which can be sent between users without a trusted third-party intermediary ‚Äî with the stable value of the US dollar. <br/> Stablecoins are increasingly used as an inflation hedge in recent times; compared to keeping fiat currency in a savings account averaging 0.06%, users can lend their stablecoins and earn yields ranging from 3% to as high as 20%. However, keep in mind that regulatory, platform risks and more entail.', 'https://tether.to/', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (30, '0000792', 'Binance', 'Binance is a global cryptocurrency exchange that provides a trading platform for over 100 cryptocurrencies. Since the beginning of 2018, Binance has been considered the largest cryptocurrency exchange in the world in terms of trading volume. Binance\'s English Binance name is based on the combination of the words binary and finance.', 'https://www.binance.com/en', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
INSERT INTO `galaxy` VALUES (31, '0001377', 'Cyber ‚Äã‚ÄãBoar', 'Cyber ‚Äã‚ÄãBoar V.1 is a collection of unique 500 NFTs on the Solana blockchain. This collection will be a pass to the WEB3 ecosystem Universe Cyber ‚Äã‚ÄãBoar. Developed tokenomics and P2E game will bring passive income to our holders. Join us and together we will reach the stars!! Also, this collection will be a WL pass for future Cyber ‚Äã‚ÄãBoar V.2 ( Mutant Version )', 'https://www.launchmynft.io/collections/4RVKD2r8yavsE2mbVAcsBTMTzTeu8Vq8k4gs5efCeEfM/HkiEXtXwbbgEtNQoCSpd', 'Normal', '0.01%', 'https://storage.googleapis.com/discoverilla-galaxy/image/0000001.jpg', '', NULL, NULL);
